~---sql aula 27 - CREATE TABLE + DESAFIO

--NOT NULL NAO PERMITE NULOS
---UNIQUE - FORÇA QUE TODOS OS VALORES EM UMA COLUNA SEJAM DIFRENTES
---PRIMARY KEY - UMA JUNÇÃO DE NOT NULL E UNIQUE
---FOREIGN KEY IDENTIFICA UNICAMENTE UMA LINHA EM OUTRA TABELA
---CHECK - FORÇA UMA CONDIÇÃO ESPECIFICA EM UMA COLUNA
---DEFAULT - FORÇA UM VALOR PADRAO QUANDO NENHUM É PASSADO

CREATE TABLE Canal (
canalid INT Primary key,
Nome VARCHAR(150) NOT NULL,
ContagemInscritos INT DEFAULT 0, 
DATACRIAÇÃO DATETIME NOT NULL
);

CREATE TABLE video(
VIDEOID INT PRIMARY KEY,
NOME VARCHAR(150) NOT NULL,
VIZUALICOES INT DEFAULT 0,
LIKES INT DEFAULT 0,
DISLIKES INT DEFAULT 0,
DURACAO INT NOT NULL,
CANALID INT FOREIGN KEY REFERENCES Canal(CANALID)
);

